import React from 'react';
import logo from './logo.jpg';
import './App.css';
import './Buttons/Buttons';

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <div className="img-div">
            <img src={logo} className="logo" alt="logo" />
          </div>
      </header>
    </div>
  );
}

export default App;
